import React from 'react';

const ImageDisplay = ({ imageUrl }) => {
  if (!imageUrl) {
    return null; // Если imageUrl отсутствует, ничего не отображается
  }

  return <img src={imageUrl} alt="Изображение" />;
};

export default ImageDisplay;
